import Container from '../../Container.jsx';
import './footer.css';
import logo from '../img/Logo.svg';



function Footer() {
  return (
     <footer>
<Container>

<div className="footerbox">
       <div className="contactus">

       </div>
       <div className="logo">
        
       </div>
</div>

</Container>
     </footer>
  );
}

export default Footer;
